//---------------------- Apex Bubble Chart ----------------
<div id="apex-bubble-chart" />

<script>
    function generateData(baseval, count, yrange) {
        let i = 0;
        let series = [];
        while (i < count) {
            let y = Math.floor(Math.random() * (yrange.max - yrange.min + 1)) + yrange.min;
            let z = Math.floor(Math.random() * (75 - 15 + 1)) + 15;

            series.push([baseval, y, z]);
            baseval += 86400000;
            i++;
        }
        return series;
    }

    let options = {
        chart: {
            height: 350,
            type: 'bubble',
            toolbar:{
                show:false
            }
        },
        dataLabels: {
            enabled: false
        },
        series: [{
            name: 'Product1',
            data: generateData(new Date('11 Feb 2017 GMT').getTime(), 20, {
                min: 10,
                max: 40
            })
        },
            {
                name: 'Product2',
                data: generateData(new Date('11 Feb 2017 GMT').getTime(), 20, {
                    min: 10,
                    max: 40
                })
            },
            {
                name: 'Product3',
                data: generateData(new Date('11 Feb 2017 GMT').getTime(), 20, {
                    min: 10,
                    max: 40
                })
            }
        ],
        fill: {
            type: 'gradient',
        },
        colors:['#0084ff', '#00ca00', '#e64141'],
        title: {
            text: '3D Bubble Chart'
        },
        xaxis: {
            tickAmount: 12,
            type: 'datetime',

            labels: {
                rotate: 0,
            }
        },
        yaxis: {
            max: 40
        },
        theme: {
            palette: 'palette2'
        }
    };

    let chart = new ApexCharts(
        document.querySelector("#apex-bubble-chart"),
        options
    );

    chart.render();
</script>
                                                    `}
